import React, { Fragment, useState } from "react";
export const Createcard = () => {

// insert Value
  const [e_name,setename] = useState("");
  const [e_email,sete_email] = useState("");
  const [e_age,sete_age]=useState("");
  const [e_salary,sete_salary]=useState("");
  const [e_address,sete_address] = useState("");
  const [e_joining_date,sete_joining_date]=useState("");
  const [e_total_sell,sete_total_sell] = useState("");

  const onSubmitForm = async (e) => {
    e.preventDefault();
    try {

      const body = {e_name,e_email,e_age,e_salary,e_address,e_joining_date,e_total_sell };
      const response = await fetch('http://localhost:3000/api/v1/employee', {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(body),

      });
      console.log(body)
    //   // window.location = "/";
    //   console.log(response)
    // } catch (err) {
    //   console.error(err.message);
    // }
    if (!response.ok) {
      throw new Error('Network response was not ok');
    }

    const data = await response.json(); // Parse the JSON response
    console.log('Success:', data); // Handle the response data
  } catch (error) {
    console.error('Error:', error); // Handle any errors
  }
};


  // };


// delete


  return (
    <Fragment>
<div class="max-w-md mx-auto mt-10 bg-white shadow-lg rounded-lg overflow-hidden">
    <div class="text-2xl py-4 px-6 bg-gray-900 text-white text-center font-bold uppercase">
        Book an Appointment
    </div>
    <form class="py-4 px-6" action="" method="POST">
        <div class="mb-4">
            <label class="block text-gray-700 font-bold mb-2" for="name">
                Name
            </label>
            <input
                class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                value={e_name}
                onChange={(e) => setename(e.target.value)}
                id ="e_name"/>
        </div>
        <div class="mb-4">
            <label class="block text-gray-700 font-bold mb-2" for="email">
                Email
            </label>
            <input
                class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"

                value={e_email}
                onChange={(e) => sete_email(e.target.value)}
                id ="e_email"/>

        </div>
        <div class="mb-4">
            <label class="block text-gray-700 font-bold mb-2" for="phone">
                Phone Number
            </label>
            <input
                class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                value={e_age}
                onChange={(e) => sete_age(e.target.value)}
                id ="e_age"/>
        </div>
        <div class="mb-4">
            <label class="block text-gray-700 font-bold mb-2" for="date">
                Date
            </label>
            <input
                class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                value={e_salary}
                onChange={(e) => sete_salary(e.target.value)}
                id ="e_salary"/>
        </div>
        <div class="mb-4">
            <label class="block text-gray-700 font-bold mb-2" for="time">
                Time
            </label>
            <input
                class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                value={e_address}
                onChange={(e) => sete_address(e.target.value)}
                id ="e_address"/>
        </div>

        <div class="mb-4">
            <label class="block text-gray-700 font-bold mb-2" for="time">
                Time
            </label>
            <input
                class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                value={e_joining_date}
                onChange={(e) => sete_joining_date(e.target.value)}
                id ="e_joining_date"/>
        </div>

        <div class="mb-4">
            <label class="block text-gray-700 font-bold mb-2" for="time">
                Time
            </label>
            <input
                class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                value={e_total_sell}
                onChange={(e) => sete_total_sell(e.target.value)}
                id ="e_totsl_sell"/>
        </div>

        <div class="mb-4">
            <label class="block text-gray-700 font-bold mb-2" for="message">
                Message
            </label>
            <textarea
                class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="message" rows="4" placeholder="Enter any additional information"></textarea>
        </div>
        <div class="flex items-center justify-center mb-4">
            <button
                class="bg-gray-900 text-white py-2 px-4 rounded hover:bg-gray-800 focus:outline-none focus:shadow-outline"
                onClick={onSubmitForm}>
                Book Appointment
            </button>
        </div>

    </form>
</div>
    </Fragment>
  );
};
